cpm_caps = {'frame_0000.jpg': '图片展示了一个办公室环境，一名男性坐在办公桌前。他穿着一件蓝白条纹衬衫，手里拿着一个黑色物体，可能是遥控器或智能手机。他的注意力似乎集中在桌子上的某物上，虽然从这个角度看不到。在他身后是一个白色的隔断，上面挂着一些装饰品，比如一个黄色的鸭子和一个绿色的球形物体。桌子上放着一台电脑显示器、键盘和其他一些文件和文具。在右边，另一张桌子上有更多物品，包括文件和另一个显示器。整个房间看起来整洁有序，地板是灰色的，墙壁是浅色的。',
'frame_0001.jpg': '图片显示一个室内场景，看起来是一个办公室。一个人坐在椅子上，面对着桌子，用右手拿着手机放在耳边。这个人穿着一件有横条纹的深蓝色和浅蓝色衬衫。桌子上有一台电脑显示器、键盘、鼠标和各种文件。背景中可以看到另一个办公桌，上面有盆栽植物和办公用品。房间里的灯光是人工的，墙壁是白色的，地板铺着灰色地毯。整体环境给人一种专业和井然有序的感觉。',
'frame_0002.jpg': '图片展示了一个室内办公环境，一个人坐在一个办公隔间里。这个人穿着一件条纹短袖衬衫，主要是白色和蓝色的条纹，并且正在用右手拿着手机靠近耳朵通话。在他们面前是一个黑色的办公椅，左边有一个电脑显示器、键盘和鼠标放在桌子上。桌子上还有各种物品，包括一盆绿色植物、一个黄色物体（可能是装饰品）和一些文具用品。背景中可以看到另一个隔间，里面有一把椅子、一个文件柜和另一台电脑。地板是灰色的地毯，墙壁涂成浅色，整个房间的氛围看起来很平静。',
'frame_0003.jpg': '这幅图片描绘了一个室内办公室环境，一个人坐在办公桌前。这个人穿着一件横条纹的蓝色和白色衬衫，正在用右手拿着一部黑色手机放在耳边通话。在桌子上，有一个显示器、键盘和一些文具，包括笔和纸。在背景中，可以看到一个带有盆栽植物的隔间，给空间增添了一丝绿意。地板铺有地毯，整体色调以中性色为主，有蓝色和绿色的点缀。',
'frame_0004.jpg': '图片显示一个人坐在办公桌前，用手机打电话。这个人穿着一件蓝白条纹短袖衬衫，正在专注地交谈。在前景中，有一台电脑显示器、键盘和鼠标，表明这是一个工作环境。桌子上放着一些文具和一个盆栽植物，为办公桌增添了一丝绿意。背景中有隔断墙，可以看到另一个办公室空间，有另一张桌子和椅子。整体氛围看起来是一个现代、整洁的办公环境。',
'frame_0005.jpg': '这幅图片描绘了一个室内场景，具体来说是一个办公室。一个年轻男子坐在前景的办公桌前，面向左侧，部分背对着镜头。他穿着一件横条纹短袖衬衫，颜色是深浅蓝色相间。他的头发黑色并短而整洁。这个男人手里拿着一支笔，看起来正在写作或准备写字。在他面前是一台电脑显示器，他似乎在专注地看着它。桌子上还放着一个键盘和鼠标。在背景中，可以看到另一个办公桌，上面放着一台显示器、一盆绿色植物以及一些文件。房间采用中性色调装饰，墙壁为米色，地板铺有地毯。整体氛围平静而专业。',
'frame_0006.jpg': '图片显示了一个室内办公环境，一个男人坐在一张白色桌子前。他穿着一件条纹短袖衬衫，正在转身，可能是朝着镜头外的某人或某物看去。桌子上有一台黑色显示器、键盘和鼠标，以及各种办公用品和个人物品，包括盆栽植物和一束色彩鲜艳的人造花。背景中有隔板将工作空间分隔开，另一个人部分可见。地板是灰色地毯，整体色调中性，有蓝色点缀。',
'frame_0007.jpg': '这幅图片展示了一个办公室环境，重点放在一个人身上，他正在向右看。这个人穿着一件横条纹的衬衫和卡其色裤子。他的姿势表明他可能在移动或对画面外的东西做出反应。背景包括一个带蓝色装饰的隔断墙，上面有几盆植物和一些色彩鲜艳的玩具，为办公环境增添了一丝俏皮感。桌子上有一个电脑显示器、键盘和鼠标，显示出这是一个工作空间。整体光线明亮均匀，表明室内灯光良好。',
'frame_0008.jpg': '这幅图片描绘了一个办公室环境，重点放在一个工作隔间上。隔间被高高的分隔板围起来，顶部装饰着一些色彩鲜艳的玩具和小饰品，包括看起来像是塑料花和可能是一个绿色的毛绒玩具。在前景中，有一张白色的办公桌，上面放着一台黑色显示器、键盘和鼠标。一把带有网格背部设计的黑色办公椅面向桌子。桌子上还摆放着一盆大绿植、一支笔和一个黑色的物体，可能是遥控器或电子设备。背景显示了另一个类似的隔间，以及一个穿着条纹衬衫的人部分出现在画面右侧，暗示着有人在场。地板铺有地毯，整体色调为中性色，除了玩具和植物外，这些物品为场景增添了色彩。',
'frame_0009.jpg': '图片展示了一个办公室环境，其中有一个隔间，里面有一张办公桌、一把椅子和一个电脑显示器。在桌子上，有一个盆栽植物，看起来像是蕨类植物，以及一些小物件，包括一副眼镜、一支笔和一个小记事本或笔记本。隔间的墙是白色的，上面挂着一些彩色的装饰品，看起来像是用塑料制成的小玩具或装饰物，颜色有黄色、红色、绿色和蓝色。地板铺着灰色地毯，背景中可以看到另一个隔间的一部分，那里也有一个办公桌和一把椅子。整个场景的灯光均匀，暗示这是一个室内空间，可能是在白天，因为没有明显的阴影。'}

